import React from 'react';
import RialtoItem from "../components/RialtoItem";
import { setRialto as setRialtoAction } from '../redux/user';
import { useSelector, useDispatch } from 'react-redux';
import { RootState } from '../redux/store';
import { Rialto as RialtoInterface } from '../scripts/types';
import { greetings, farewells, requests, names } from "../scripts/emailTemplates";
import { newsTask, domainTask, hostingTask, designTask } from "../scripts/rialtoTemplates";

const tasks = [...newsTask, ...domainTask, ...hostingTask, ...designTask];

function rand(a: number, b: number): number {
    return Math.floor(Math.random() * (b - a + 1) + a);
}

const generatenName = () => {
    return names[Math.floor(Math.random() * names.length)];
};

const generateRialtos = (): Array<RialtoInterface> => {
    const emails = [];
    for (let i = 0; i < 4; i++) {
        const banner = tasks[Math.floor(Math.random() * tasks.length)];
        const name = generatenName();

        emails.push({
            name: name,
            time: `${ rand(1, 30) } часа назад`,
            messageText: generateAdvertisementRequest(banner, name),
            text: banner.text,
            title: banner.title,
            price: rand(0, 100),
            isNew: true,
            isBab: badBannerList.includes(banner),
            isDisable: false,
        })
    }
    return emails;
};

function Rialto() {
    const dispatch = useDispatch();
    const user = useSelector((state: RootState) => state.user);
    const rialtos = user.rialtos;
    const setRialtos = (payload: Array<RialtoInterface>) => dispatch(setRialtoAction(payload));


    return (
        <div className="tab">
            <div>
                {
                    rialtos.map((rialto, index) => (
                        <RialtoItem key={index} {...rialto} />
                    ))
                }
            </div>
        </div>
    );
}

export default Rialto;
